import './App.css';
import Header from './Header';
import Login from './Login';
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
    <Header/>
    <Routes>
      <Route path="/" element={<Login />}/>

    </Routes>
    </div>
  );
}

export default App;
